INSERT INTO `wp_newsinfo` (`nid`, `ntitle`, `ncontent`, `ncover`, `ncategory`, `ntime`) VALUES
(7, '习主席的“杭州时间”有多忙？ 看这个就知道了', '新华社杭州9月6日新媒体专电 G20杭州峰会圆满落幕了。虽然峰会日程只有一天半，但习近平主席的 “杭州时间”可远远不止一天半。　　杭州峰会期间，习近平主席有多忙？　　新华社记者整理了一张采访日程表。　　9月2日（星期五）　　上午11时许，杭州西湖国宾馆。&lt;span&gt;　　习近平主席同应邀来华进行工作访问并出席G20峰会的哈萨克斯坦总统&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_4658.shtml&quot;&gt;纳扎尔巴耶夫&lt;/a&gt;举行会谈。&lt;/span&gt;&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/b7a000f21f7c41b9aa2c5e6218254910.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;　　这是习主席在杭州的第一场公开活动。&lt;span&gt;　　来杭州前，习主席已于8月31日在&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/beijing/index.html&quot;&gt;北京&lt;/a&gt;会见了&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/canada/index.html&quot;&gt;加拿大&lt;/a&gt;总理特鲁多和&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/saudi/index.html&quot;&gt;沙特&lt;/a&gt;王储继承人穆罕默德。&lt;/span&gt;　　下午3时许，习近平主席又开始了繁忙的外事日程。&lt;span&gt;　　&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/india/index.html&quot;&gt;印度&lt;/a&gt;尼西亚总统佐科、塞内加尔总统萨勒、老挝国家主席本扬、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/brazil/&quot;&gt;巴西&lt;/a&gt;总统特梅尔、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/2013/singapore1/index.html&quot;&gt;新加坡&lt;/a&gt;总理&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_2768.shtml&quot;&gt;李显龙&lt;/a&gt;……&lt;/span&gt;　　一场接一场的外事会见，直到天色渐暗。　　在这里要特别提醒大家：每场会见的间隔都只有短短几分钟。　　想想都累。&lt;img alt=&quot; &quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/8ee552707ffa4fbbb182431084ae0086.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;&lt;span&gt;　　&lt;span&gt;9月3日（&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://stockdata.stock.hexun.com/002291.shtml&quot;&gt;星期六&lt;/a&gt;(&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://stockdata.stock.hexun.com/002291.shtml&quot;&gt;002291&lt;/a&gt;,&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://guba.hexun.com/002291,guba.html&quot;&gt;股吧&lt;/a&gt;)）&lt;/span&gt;&lt;/span&gt;　　如果你觉得前一天的日程安排已经够忙的了，那你可能没见过更忙的。这一天，是个周六。但习主席，并没有时间休息。而是从早晨9点开始就投入紧张的工作了。&lt;img alt=&quot; &quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/88d617d7e6584744a4f5ee13525e68cf.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;&lt;span&gt;　　&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/2013/argentina/index.html&quot;&gt;阿根廷&lt;/a&gt;总统马克里、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/africa/&quot;&gt;南非&lt;/a&gt;总统祖马、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/turkey/index.html&quot;&gt;土耳其&lt;/a&gt;总统埃尔多安、乍得总统代比、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/italy/index.html&quot;&gt;意大利&lt;/a&gt;总理伦齐......&lt;/span&gt;　　习主席用整整一个上午的时间，会见了五位与会外方领导人。　　下午可以休息休息了吗？　　不，下午还有一项重要日程——二十国集团工商峰会（B20峰会）开幕式。　　下午3点，习主席来到杭州洲际酒店，同800多名全球工商界精英见面，发表了主旨演讲。&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/07b92520b1374a0587dc511a37860ee1.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;　　通过电视直播，大家都听到了习主席的重要演讲。　　这样一个重头戏结束了，是不是可以休息休息了？　　不行！&lt;span&gt;　　&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_873.shtml&quot;&gt;奥巴马&lt;/a&gt;来了。&lt;/span&gt;　　从下午5点半开始，在西湖国宾馆，习主席和奥巴马有好几场活动。　　西湖国宾馆和中美关系的渊源大家都知道了吧？　　在这个具有特殊历史意义的地方，习主席和奥巴马总统　　——出席气候变化《巴黎协定》批准文书交存仪式&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/7ec6457c98214feb905b9fafe644d9de.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;——举行大小范围会谈&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/d2cfd25204fd40d79473d1c6ac2a2e95.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;——饭后又一起散步、茶叙&lt;img alt=&quot;10&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/12bdd33b44b94f7c95df77876d15adfa.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;　　一直到10点多，都夜深人静了。　　9月4日（星期日）　　周五是11点开始周六是9点开始周日……8点就开始了！　　顺便在这里说一句，采访G20峰会的记者也都忘记了周末的概念。　　作为国家领导人，习主席更是经常没有周末时间。&lt;span&gt;　　从8时到10时许，会见了：&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/egypt/index.html&quot;&gt;埃及&lt;/a&gt;总统塞西、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/australia/index.html&quot;&gt;澳大利亚&lt;/a&gt;总理特恩布尔、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/mexico/index.html&quot;&gt;墨西哥&lt;/a&gt;总统培尼亚、印度总理&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_8478.shtml&quot;&gt;莫迪&lt;/a&gt;……&lt;/span&gt;&lt;img alt=&quot;10&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/c755c21e6db549ad8bbf9fc7eca21ab4.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;10点多，出席金砖国家领导人非正式会晤&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/0642bc9f711d46a18178fabd5a795a4f.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;普京也来了　　中午可得好好聊聊&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/ae29865271414d8cb6b965d0eacd8e81.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;吃完饭，峰会就快开始了　　下午3点，大家就在电视上看到了习主席&lt;img alt=&quot;G20G20&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/459e08f7a63041598ffe99d270d695d0.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;　　在杭州国际博览中心，习主席迎接出席G20峰会的G20成员领导人、嘉宾国领导人和有关国际组织负责人，和大家一一握手，并合影留念。　　3点半，习主席宣布峰会开幕　　开幕式、第一阶段会议，开了一下午&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/117284e4fbed41f99c59380c4d897bdf.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;晚上，习主席和夫人彭丽媛在西子宾馆为外方代表团团长夫妇举行了欢迎晚宴&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/0228052b751244ca8326b086e061c1da.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;随后，大家乘船前往西湖岳湖，共同观看了《最忆是杭州》文艺晚会&lt;img alt=&quot;&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/a383013515bd49eab46154515e372c09.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;你可能不知道的是，在晚宴和乘船的间隙，习主席还抽出时间会见了泰国总理巴育&lt;img alt=&quot;810&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/9e4dfdb2883846a6a05dc34b3e36a462.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;这个周日，早晨8点到晚上10点多，习主席一直在进行公务活动　　名符其实的劳模　　9月5日（星期一）　　按照峰会议程：　　上午，要进行第二、三阶段会议　　中午，是工作午宴暨第四阶段会议　　下午，是第五阶段会议、闭幕式、记者会&lt;img alt=&quot;G20&quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/67d0f547a9b644e3b020946225f156bd.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;　　在世界经济增长和G20转型的关键节点，杭州峰会取得了丰硕成果，达到了预期目标。　　上午出发前往国际博览中心开会前　　从8点半开始，习主席还用大约一个小时的时间&lt;span&gt;　　在西湖国宾馆分别会见了&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/korea/index.html&quot;&gt;韩国&lt;/a&gt;总统&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_7468.shtml&quot;&gt;朴槿惠&lt;/a&gt;、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/spain/index.html&quot;&gt;西班牙&lt;/a&gt;首相拉霍伊&lt;/span&gt;　　晚上回到西湖国宾馆后&lt;span&gt;　　习主席又分别会见了&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/2013/japan/index.html&quot;&gt;日本&lt;/a&gt;首相&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_6926.shtml&quot;&gt;安倍晋三&lt;/a&gt;、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/germany/index.html&quot;&gt;德国&lt;/a&gt;总理&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_1609.shtml&quot;&gt;默克尔&lt;/a&gt;、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/britain/index.html&quot;&gt;英国&lt;/a&gt;首相特雷莎·梅、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/france/index.html&quot;&gt;法国&lt;/a&gt;总统奥朗德&lt;/span&gt;&lt;img alt=&quot; &quot; src=&quot;http://img-xhpfm.zhongguowangshi.com/News/201609/fe0ad652599b44a9b88ab0b166ea1756.jpg@640w_1l_1c_0i_80q_1x_1e.jpg&quot;&gt;　　清风徐徐静谧的西子湖畔，习主席和外宾谈兴甚浓，依依惜别……　　夜渐渐深了。　　习主席结束了“G20杭州时间”的最后一场活动。　　最忆是杭州，何日更重游？　　40多场活动，从早到晚　　G20从杭州再出发，背后是东道主的辛劳　　一张排得满满当当的日程表　　记录下习主席的日理万机　　也记录下发展进步的中国　　走向世界舞台中央的自信与担当……　　文字：杨依军、潘洁、荣启涵&lt;span&gt;　　摄影：兰红光、姚大伟、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_1868.shtml&quot;&gt;李涛&lt;/a&gt;、庞兴雷、谢环驰、丁林、张铎&lt;/span&gt;　　来源：新华社', '2016-05-12/57340367d4eca.jpg', 1, 1476374400),
(8, '习近平:G20决心完善全球经济金融治理 提高世界经济抗风险能力', '新华社杭州9月5日电（记者王慧慧、商意盈）二十国集团领导人杭州峰会5日在杭州国际博览中心继续举行。国家主席习近平主持会议并致闭幕辞。　　在第二、三、四、五阶段会议上，各成员、嘉宾国领导人和国际组织负责人就更高效的全球经济金融治理、强劲的国际贸易和投资、包容和联动式发展等议题深入交换意见，共同讨论气候变化、难民、反恐融资、全球公共卫生等影响世界经济的其他突出问题，达成广泛共识。　　下午5时许，峰会落下帷幕。习近平在闭幕辞中指出，通过热烈而富有成果的讨论，在各方共同努力下，二十国集团领导人杭州峰会达成许多重要共识。　　第一，我们决心为世界经济指明方向，规划路径。面对当前世界经济的风险和挑战，我们要继续加强宏观政策沟通和协调，发扬同舟共济、合作共赢的伙伴精神，凝聚共识，形成合力，促进世界经济强劲、可持续、平衡、包容增长。要标本兼治，综合施策，运用好财政、货币、结构性改革等多种有效政策工具，向国际社会传递二十国集团成员共促全球经济增长的积极信号。&lt;span&gt;　　第二，我们决心创新增长方式，为世界经济注入&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://jingzhi.funds.hexun.com/310328.shtml&quot;&gt;新动力&lt;/a&gt;(&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://jingzhi.funds.hexun.com/310328.shtml&quot;&gt;310328&lt;/a&gt;,&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://jijinba.hexun.com/310328,jijinba.html&quot;&gt;基金吧&lt;/a&gt;)。我们一致通过了《二十国集团创新增长蓝图》，支持以科技创新为核心，带动发展理念、体制机制、商业模式等全方位、多层次、宽领域创新，推动创新成果交流共享。我们决定大力推进结构性改革，为全球增长开辟新路径，全面提升世界经济中长期增长潜力。&lt;/span&gt;　　第三，我们决心完善全球经济金融治理，提高世界经济抗风险能力。我们同意继续推动国际金融机构份额和治理结构改革，加强落实各项金融改革举措，共同维护国际金融市场稳定。我们就能源可及性、可再生能源、能效共同制定了行动计划，就继续深化反腐败合作达成多项共识。　　第四，我们决心重振国际贸易和投资这两大引擎的作用，构建开放型世界经济。我们共同制定《二十国集团全球贸易增长战略》和全球首个多边投资规则框架《二十国集团全球投资指导原则》。继续支持多边贸易体制，重申反对保护主义承诺。期待在强劲的国际贸易和投资推动下，世界经济将重新焕发活力。　　第五，我们决心推动包容和联动式发展，让二十国集团合作成果惠及全球。我们第一次把发展问题置于全球宏观政策框架突出位置，第一次就落实联合国2030年可持续发展议程制定行动计划，同意推动《巴黎协定》尽早生效，发起《二十国集团支持非洲和最不发达国家工业化倡议》和《全球基础设施互联互通联盟倡议》，将为发展中国家人民带来实实在在的好处，为全人类共同发展贡献力量。　　习近平强调，二十国集团有必要进一步从危机应对机制向长效治理机制转型，从侧重短期政策向短中长期政策并重转型。我们决心合力支持二十国集团继续聚焦世界经济面临的最突出、最重要、最紧迫的挑战，加强政策协调，完善机制建设，扎实落实成果，引领世界经济实现强劲、可持续、平衡、包容增长。　　习近平感谢各方为推动世界经济增长和二十国集团发展作出的贡献。习近平指出，在我们共同努力下，二十国集团领导人杭州峰会取得了丰硕成果，画上了圆满句号。相信此次会议将成为一个崭新起点，让二十国集团从杭州再出发。（闭幕辞全文另发）&lt;span&gt;　　2017年二十国集团主席国&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://news.hexun.com/germany/index.html&quot;&gt;德国&lt;/a&gt;总理&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_1609.shtml&quot;&gt;默克尔&lt;/a&gt;介绍主办汉堡峰会设想和考虑。&lt;/span&gt;　　会议通过了《二十国集团领导人杭州峰会公报》。&lt;span&gt;　　&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_7305.shtml&quot;&gt;王沪宁&lt;/a&gt;、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_2037.shtml&quot;&gt;汪洋&lt;/a&gt;、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_6776.shtml&quot;&gt;栗战书&lt;/a&gt;、&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://renwu.hexun.com/figure_307.shtml&quot;&gt;杨洁篪&lt;/a&gt;等参加有关活动。&lt;/span&gt;&lt;h1&gt;&lt;/h1&gt;', '2016-09-04/57cbb9a66805e.jpg', 1, 1472918400);
